import { useForm } from "react-hook-form";

function ItineraryForm() {
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm({
    mode: "all",
  });

  const onSubmit = (data) => console.log(data);

  console.log(errors);

  return (
    <div className="ItineraryForm">
      <form onSubmit={handleSubmit(onSubmit)} autoComplete="off">
        <fieldset>
            <h2>Start a New Trip!</h2>
            <label>Trip Name</label>
            <input
            {...register("tripName", {
                required: "Trip Name is Required...",
                minLength: {
                value: 3,
                message: "Trip Name must be at least 3 characters long...",
                },
                maxLength: {
                value: 30,
                message: "Trip Name must be at most 30 characters long...",
                },
            })}
            placeholder="Trip To..."
            />
            <p>{errors.tripName?.message}</p>
            <input
            {...register("email", {
                required: "Email is Required...",
                pattern: {
                value:
                    /^(([^<>()[\]\\.,;:\s@"]+(\.[^<>()[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/,
                message: "Email must be valid",
                },
            })}
            placeholder="Email"
            />
            <p>{errors.email?.message}</p>
            <input
            {...register("password", {
                required: "Password is Required...",
                pattern: {
                value:
                    /^(?=.*[0-9])(?=.*[!@#$%^&*.,])[a-zA-Z0-9!@#$%^&*.,]{6,16}$/,
                message:
                    "Password Must Contain Atleast 6 Characters, One Uppercase, One Lowercase, One Number and One Special Case Character",
                },
            })}
            placeholder="Password"
            />
            <p>{errors.password?.message}</p>
            <select
            {...register("gender", {
                required: "Gender is Required...",
            })}
            >
            <option value="">Select Gender</option>
            <option value="female">Female</option>
            <option value="male">Male</option>
            <option value="other">Other</option>
            </select>
            <p>{errors.gender?.message}</p>
        </fieldset>
        <input type="Submit" />
      </form>
    </div>
  );
}

export default ItineraryForm;

